import React from "react";
import FundraisingProject from "./FundraisingProject";

const styles = {
    ul: {
        listStyle: 'none',
        margin: 0,
        padding: 0
    }
};

let fundraisingProjects = {};

function allProjects() {
    fetch(`http://localhost:18080/fundraising-projects/all`, {
        method: 'GET',
        headers: new Headers({
            "Authorization": sessionStorage.jwtToken
        })
    }).then(response => response.json())
        .then(json => {fundraisingProjects = json});
}

allProjects();

export default function FundraisingProjects() {

    return (
        <ul style={styles.ul}>
            <FundraisingProject/>
            <FundraisingProject/>
            <FundraisingProject/>
        </ul>
    );
}
